import execjs
import base64


def execute_javascript(js_file, image_decrypt_data):
    js_code = open(js_file).read()
    ctx = execjs.compile(js_code)
    return ctx.call('decryptFn', image_decrypt_data)


def save_image(js_file, image_out_path, image_decrypt_data):
    image_data = execute_javascript(js_file, image_decrypt_data)
    # 删除图片base64转码后的data:image/jpeg;base64,
    image_data = image_data.replace('data:image/jpeg;base64,', '')
    with open(image_out_path, 'wb') as f:
        f.write(base64.b64decode(image_data))


if __name__ == "__main__":
    js_file = r"F:\task\含羞草.js"
    image_out_path = "含羞草.jpeg"
    decrypt_data = ''

    save_image(js_file, image_out_path, decrypt_data)